    @patch('aiohttp.ClientSession.get')
    async def test_fetch_all_data_success(self, mock_get):
        mock_response = AsyncMock()
        mock_response.status = 200
        mock_response.json = AsyncMock(return_value=TestFetchData.response_json)
        mock_get.return_value.__aenter__.return_value = mock_response

        urls = ["https://bama.ir/cad/api/search?pageIndex=0", "https://bama.ir/cad/api/search?pageIndex=1"]
        results = await fetch_all_data(urls)

        assert len(results) == 2
        for result_url, cars in results:
            assert result_url in urls
            assert isinstance(cars, list)
            assert len(cars) > 0

